import React from 'react';
import Marquee from 'react-marquee-master';
import './styles/Lists.scss';

function Lists() {

    const marqueeItems = ['One', 'Two', 'Three', 'One1', 'Two2', 'Three3'];
    return (<div height='300px' className='fixed-bottom player'>
        <p>Menu Heading</p>
        <Marquee direction='up' marqueeClassName='bg-warning' minHeight='250' marqueeItems={marqueeItems} /></div>) 
}

export default Lists;
